function acionaComando(){
    global $db;
    $tempo_inicio = time();
    $sql_obras = " SELECT o.obrid, htd.usucpf, htd.htddata, o.usucpfinclusao
                   FROM workflow.historicodocumento  htd
                   JOIN workflow.acaoestadodoc aed ON aed.aedid = htd.aedid
                   JOIN obras2.obras             o ON o.docid = htd.docid
                   WHERE htd.aedid = 1945";
    $dadosAtualizacao = $db->carregar($sql_obras);
    $dados_2 = $db->pegaLinha($sql_obras,1);
    $cabecalho2 = array();
    foreach ($dados_2 as $key => $value) {
        $cabecalho2[] = $key;
    }
    $db->monta_lista($sql_obras,$cabecalho2,30,5,'N','center','');
    foreach ($dadosAtualizacao as $key => $value) {
        $obra  = new Obras($value['obrid']);
        $obra->usucpfinclusao = empty($obra->usucpfinclusao) ? $value['usucpf'] :  $obra->usucpfinclusao;
        if(trim($obra->obrdtinclusao) == '' || $obra->obrdtinclusao == false){
            $obra->obrdtinclusao = $value['htddata'];
        }
        if(trim($obra->usucpfinclusao) == '' || $obra->usucpfinclusao == false){
            $obra->usucpfinclusao = $value['usucpf'];
        }
        $obrid = $obra->salvar();
        if($obrid){
            $erro = false;
        }else{
            $erro = true;
        }
    }
    if($erro){
        $obra->rollback();
    }else{
        $obra->commit();
    }
    $dadosAtualizacao = $db->carregar($sql_obras);
    echo '<pre>';
    echo '<h1>TOTAL de Obras Modificadas</h1>';
    var_dump(count($dadosAtualizacao));
    echo '<h1>IDs, Obras Modificadas</h1>';
    $c = 0;
    foreach ($dadosAtualizacao as $key => $value) {
        echo "<b>ID:</b> ".$value['obrid'].", ";
        $c++;
        if($c % 10 == 0){ echo "<br>"; }
    }
    echo '</pre>';
    $tempo_fim = time();
    $duracaoS  = $tempo_fim - $tempo_inicio;
    $duracaoM  = ($duracaoS/60);
    echo '<h2>TEMPO DE EXECUÇÃO: </h2> Segundos: '.$duracaoS.'<br> Minutos: '.$duracaoM;
    $dados_2 = $db->pegaLinha($sql_obras,1);
    $cabecalho2 = array();
    foreach ($dados_2 as $key => $value) {
        $cabecalho2[] = $key;
    }
    $db->monta_lista($sql_obras,$cabecalho2,30,5,'N','center','');
}

